import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { MapPin, AlertTriangle, CheckCircle2, Circle } from 'lucide-react';

const ChileMap = ({ sensors = [], onSelectSensor = () => {} }) => {
  const [tooltipContent, setTooltipContent] = useState('');
  const [tooltipPosition, setTooltipPosition] = useState({ x: 0, y: 0 });

  // Posiciones aproximadas de los marcadores en el mapa (basadas en un mapa de Chile vertical 600px de alto)
  const markerPositions = {
    '1': { top: '25%', left: '50%' }, // Santiago (centro)
    '2': { top: '45%', left: '48%' }, // Concepción (sur-centro)
    '3': { top: '65%', left: '52%' }, // Puerto Montt (sur)
  };

  const colorScale = (value) => {
    if (value < 30) return '#ef4444'; // Rojo para crítico
    if (value < 60) return '#facc15'; // Amarillo para warning
    return '#22c55e'; // Verde para normal
  };

  const handleMouseEnter = (sensor) => {
    if (sensor) {
      setTooltipContent(`${sensor.name} - Nivel: ${sensor.value}% - Estado: ${sensor.status.toUpperCase()}`);
    }
  };

  const handleMouseLeave = () => {
    setTooltipContent('');
  };

  const handleMouseMove = (event) => {
    setTooltipPosition({ x: event.clientX + 10, y: event.clientY + 10 });
  };

  return (
    <motion.div
      className="relative bg-white/80 backdrop-blur-xl border border-gray-200/50 rounded-3xl p-6 shadow-xl overflow-hidden h-full flex flex-col"
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6, delay: 0.2 }}
      onMouseMove={handleMouseMove}
    >
      <h2 className="text-2xl font-bold text-gray-800 mb-6 flex items-center gap-3">
        <MapPin className="w-7 h-7 text-blue-500" />
        Mapa de Chile (Simplificado)
      </h2>
      <div 
        className="relative flex-grow w-full min-h-[400px] bg-gradient-to-b from-gray-100 to-gray-300 rounded-2xl border border-gray-200 overflow-hidden"
        style={{
          backgroundImage: `url('data:image/svg+xml;base64,')`, // SVG simple de Chile como "dibujo"
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          backgroundRepeat: 'no-repeat'
        }}
      >
        {sensors.map((sensor) => {
          const position = markerPositions[sensor.id];
          const markerColor = colorScale(sensor.value);
          const IconComponent = sensor.status === 'critical' ? AlertTriangle : CheckCircle2;
          const iconColor = sensor.status === 'critical' ? '#ffffff' : '#000000';

          return (
            <motion.div
              key={sensor.id}
              className="absolute cursor-pointer"
              style={{ ...position, transform: 'translate(-50%, -50%)' }}
              onMouseEnter={() => handleMouseEnter(sensor)}
              onMouseLeave={handleMouseLeave}
              onClick={() => onSelectSensor(sensor)}
              whileHover={{ scale: 1.3 }}
              whileTap={{ scale: 0.9 }}
            >
              <div className="relative w-12 h-12">
                <Circle className={`w-full h-full text-${sensor.status === 'critical' ? 'red' : sensor.status === 'warning' ? 'yellow' : 'green'}-500 fill-current`} />
                <IconComponent 
                  className={`absolute inset-0 m-auto w-6 h-6 ${iconColor}`} 
                  style={{ top: '50%', left: '50%', transform: 'translate(-50%, -50%)' }}
                />
              </div>
            </motion.div>
          );
        })}
      </div>

      {tooltipContent && (
        <motion.div
          className="absolute bg-gray-800 text-white text-sm px-3 py-2 rounded-lg shadow-lg pointer-events-none z-50 max-w-xs"
          initial={{ opacity: 0, scale: 0.8 }}
          animate={{ opacity: 1, scale: 1 }}
          exit={{ opacity: 0, scale: 0.8 }}
          style={{ left: tooltipPosition.x, top: tooltipPosition.y }}
        >
          {tooltipContent}
        </motion.div>
      )}

      {/* Leyenda simple para mayor claridad */}
      <div className="mt-4 pt-4 border-t border-gray-200 flex justify-center gap-8 text-sm">
        <div className="flex items-center gap-1">
          <div className="w-4 h-4 bg-red-500 rounded-full"></div>
          <span>Crítico (&lt;30%)</span>
        </div>
        <div className="flex items-center gap-1">
          <div className="w-4 h-4 bg-yellow-500 rounded-full"></div>
          <span>Advertencia (30-60%)</span>
        </div>
        <div className="flex items-center gap-1">
          <div className="w-4 h-4 bg-green-500 rounded-full"></div>
          <span>Normal (&gt;60%)</span>
        </div>
      </div>
    </motion.div>
  );
};

export default ChileMap;
